import React from 'react'
import { withRouter } from 'react-router-dom'
import injectSheet from "react-jss";
import styles from './Page404Styles'

const Page404 = (props) => {

    const {classes} = props;

    const goHome = () => {
        props.history.push('/')
    }
        return (
            <div className={classes.page_404}>
                <div className={classes.header}>404</div>
                <div className={classes.header}>Page not found</div>
                <div>
                    <button className={classes.btnGoHome} onClick={goHome}>
                        Go to home page
                    </button>
                </div>
            </div>
        )
    }

export default withRouter(injectSheet(styles)(Page404))
